import React from 'react';
import Head from 'next/head';
import styles from './navbar.module.scss';

const Navbar = () => (
    <div  >    
            <Head className={styles.navbarContainer}>
                <title> Pablo Pose</title>
                <h1> Pablo Pose</h1>
            <h1> Actor y doblaje</h1>
            </Head>
          
    </div>
)

export default Navbar;
